import styled from 'styled-components';
const ReviewComment = props => {
const { data } = props;
  return (
    <CommentBody>
      <UserProfile>
        <UserImg src={data.images}></UserImg>
        <UserInfo>
          <UserName>{data.userName}</UserName>
          <UserStarts>
            {ARRAY.map((el, index) => (
              <FaStar
                key={index}
                size="14"
                className={score[el] && 'yellowStar'}
              ></FaStar>
            ))}{' '}
            {data.score}.0
          </UserStarts>
        </UserInfo>
      </UserProfile>
      <UserComment>{data.userComment}</UserComment>
    </CommentBody>
  );
};
